import React from "react";
import NavBar from "../components/navbar";
import styled from "styled-components";
import Calendar from "react-calendar";
import 'react-calendar/dist/Calendar.css';
import { Button, Form, FormGroup, Label, Input, FormText } from "reactstrap"


const StyleWrapper = styled.div`
    .logo {
        justify-content: right;
        margin top: 0px;
        image-size: small;
    }
    h1 {
        color:  #451814;
        justify-content: center;
        text-align: center;
    }
    body {
        justify-content: center;
        text-align: center;
    }
    .calendar {
        border: 10px solid #a95534;
        border-radius: 10px;
        margin: auto 20px;
    }
    h2 {
        color: #a95534
    }
`

const handleFormSubmit = () => {

}

const Notes = () => {
    return (
        <StyleWrapper>
            <NavBar/>
         <header className="App-header">
            <img src="./logo.png" className="logo" alt="logo" />
            <h1 className="header">
            Rehearsal Notes
            </h1>
        </header>
        <body>
            <p>Select your rehearsal date</p>
            <Calendar className="calendar"/>
            <Form>
            <h2>Enter your rehearsal notes here</h2>
                <FormGroup>
                    <Input type="text" placeholder="Note Title"/>
                </FormGroup>
                <FormGroup>
                    <Input type="textarea" name="text" id="exampleText" placeholder="Note Text"/>
                </FormGroup>
                    <Button
                    onClick={handleFormSubmit}
                    >Submit
                    </Button>
                <FormGroup>
                    <Label for="exampleFile">File</Label>
                    <Input type="file" name="file" id="exampleFile" />
                    <FormText color="muted">

                    Upload your script copy to save an electronic version
                    </FormText>
                </FormGroup>
            </Form>
        </body>
        </StyleWrapper>
    )
}

export default Notes;
